import React, { useState } from 'react';

const Login = () => {
    return(
        <form>
            <input type="text"
             placeholder='Username'
            />
             <input type="Password"
             placeholder='Password'
            />
            <button type='submit'>Submit</button>
        </form>
    )
}

export default Login;
